import React from "react";
import { useEffect, useState } from "react";
import B from "./B";
const App = () => {
  const [count, setCount] = useState(0);
  console.log("App");
  useEffect(() => {
    setCount(1);
  });
  return (
    <div>
      {count}
      <B />
    </div>
  );
};

export default App;
